  \"continental-united-states-hurricane-strikes-1950-2012\",\n\t\"isopen\": false,\n\t\"url\":
  null,\n\t\"notes\": \"The Continental U.S. Hurricane Strikes Poster is our most
  popular poster which is updated annually. The poster includes all hurricanes that
  affected the U.S. since 1950 with hurricane force winds, although some did not necessarily
  make landfall. This 32\"x34\" glossy poster will give you a quick look of the location
  and strength of each hurricane which struck the continental Unites States. The map
  includes the name, category strength, year, and approximate strike location of each
  hurricane.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
